import React from 'react';
import './Menu.css';

const menuData = [
  {
    category: "Organic Beans (Coffee)",
    items: [
      { name: "Americano", price: "$5.50" },
      { name: "Double Espresso", price: "$6.00" },
      { name: "Latte", price: "$5.00 - $6.00" },
      { name: "Cappuccino", price: "$6.00 - $7.00" },
      { name: "Mocha", price: "$6.00 - $7.00" },
      { name: "Vanilla Dream", price: "$6.00 - $7.00" },
    ],
  },
  {
    category: "Tea Time",
    items: [
      { name: "Chai", price: "$3.50 - $5.00" },
      { name: "English Breakfast Tea", price: "$3.50 - $5.00" },
      { name: "Earl Grey", price: "$3.50" },
      { name: "Chamomile", price: "$3.75 - $6.00" },
      { name: "Hot Chocolate", price: "$3.75 - $6.00" },
    ],
  },
  {
    category: "Breakfast",
    items: [
      { name: "Egg Sandwiches", price: "$8.00" },
      { name: "Pick Your Bread", price: "Wraps, Croissant" },
      { name: "Pick Your Cheese", price: "American, Aged Cheddar, Swiss, and Mozzarella" },
      { name: "Pick Your Protein", price: "Bacon, Sausage, Taylor Ham" },
      { name: "Additional Add Ons", price: "Spinach, Tomatoes, Red Onion, Avocado, and Home Fries" },
      { name: "Chicken & Biscuit", price: "2 for $8.00" },
      { name: "Signature He-Man Sandwich", price: "$13.25" },
    ],
  },
  {
    category: "Organic Salads",
    items: [
      { name: "Super Green Salad", price: "$12.50" },
      { name: "Caesar Salad", price: "$14.00" },
      { name: "Buffalo Chicken Salad", price: "$14.00" },
      { name: "Susie’s House Salad", price: "$14.00" },
      { name: "Spring Mix Salad", price: "$14.00" },
    ],
  },
  {
    category: "Wraps, Rolls, Hero, Bread (Hot Sandwiches)",
    items: [
      { name: "Turkey Cuban", price: "$14.00" },
      { name: "Grilled Cheese", price: "$5.00" },
      { name: "Tomato, Basil Mozzarella", price: "$9.00" },
      { name: "Philly Cheese Steak", price: "$13.00" },
      { name: "Ham & Cheese Melt", price: "$8.00" },
      { name: "Turkey Club", price: "$13.00" },
      { name: "Herb Grilled Chicken Sandwich", price: "$13.00" },
      { name: "Susie Tuna Melt", price: "$12.00" },
    ],
  },
  {
    category: "Rice Bowl",
    items: [
      { name: "Choose Base", price: "Rice, Seasonal Vegetables, etc." },
      { name: "Choose Sauce", price: "Pesto Sauce, Garlic Butter Sauce, etc." },
      { name: "Choose Protein", price: "Shrimp, Chicken, Salmon" },
      { name: "Price", price: "$15.00" },
    ],
  },
  {
    category: "Caribbean Pot",
    items: [
      { name: "Roti with Chicken Curry", price: "$14.00" },
      { name: "Roti with Beef Curry", price: "$15.00" },
      { name: "Roti with Shrimp Curry", price: "$15.00" },
      { name: "Roti with Chickpea Curry", price: "$11.00" },
    ],
  },
  {
    category: "Pastries and Things",
    items: [
      { name: "Cheese Danish", price: "$6.00" },
      { name: "Plain Croissants", price: "$4.00" },
      { name: "Almond Croissants", price: "$5.00" },
      { name: "Muffins", price: "$5.00" },
      { name: "Cookies", price: "$2.25" },
      { name: "Donut", price: "$2.25" },
    ],
  },
  {
    category: "Drinks (Grab & Go)",
    items: [
      { name: "Martinelli Apple Juice", price: "$3.00" },
      { name: "Orange Juice", price: "$3.50" },
      { name: "Water", price: "$1.50" },
    ],
  },
];

const Menu = () => {
  return (
    <div id="menu" className="menu">
      <h2>Our Menu</h2>
      {menuData.map((section, index) => (
        <div key={index} className="menu-section">
          <h3>{section.category}</h3>
          <ul>
            {section.items.map((item, itemIndex) => (
              <li key={itemIndex}>
                <span>{item.name}</span> - <span>{item.price}</span>
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
};

export default Menu;
